import React from 'react';
// import propTypes from 'prop-types';
import css from './TransactionHistory.module.css';

const FriendList = ({ items }) => (
    <table class="transaction-history">
  <thead>
    <tr>
      <th>Type</th>
      <th>Amount</th>
      <th>Currency</th>
    </tr>
  </thead>
        {items.map(item => (
  <tbody>
    <tr>
      <td>{item.type}</td>
      <td>{ item.amount}</td>
      <td>USD</td>
    </tr>
  </tbody>
    ))}
</table>
);

export default FriendList;
